// client/src/App.js

import "./App.css";
import React, { Component } from 'react';
import Home from "./Home";
import { Routes ,Route } from 'react-router-dom';



const App = () => (
  <body>
    <Routes>
        <Route path='/' element={<Home/>}></Route>
    </Routes>
  </body>

);


export default App;
